let memory = [];
let currentPosition = 0;
let loops = [];
let positionOfLoopsBegin = [];


const translate = (code, text) => {
    let input = code;
    let correctInput = [];
    let provisionalString = "";
    //GUARDA EN UN ARRAY EL INPUT DE MANERA CORRECTA
    for (let i = 0; i < input.length; i++) {
        if (i % 2 === 0 && i > 0) {
            correctInput.push(provisionalString);
            provisionalString = ""
        }
        provisionalString = provisionalString + input.charAt(i);
        if (i === input.length - 1) {
            correctInput.push(provisionalString);
        }
    }
    //CÃLCULO ARRAY DE LOOPS
    for (let i = 0; i < correctInput.length; i++) {
        if (correctInput[i] === "ğŸ¤œ") {
            loops.push([i]);
            positionOfLoopsBegin.push(i);
        }
        if (correctInput[i] === "ğŸ¤›") {
            let numberOfLoop = loops.findIndex(array => array.find(key => key === positionOfLoopsBegin[positionOfLoopsBegin.length - 1]));
            loops[numberOfLoop].push(i);
            positionOfLoopsBegin.pop();
        }
    }
    console.log(loops);
    //RECORRE EL ARRAY CORRECTO E INTERPRETA CADA MANO
    for (let i = 0; i < correctInput.length; i++) {
        switch (correctInput[i]) {
            //BAJAR VALOR DE LA CELDA DE MEMORIA ACTUAL
            case 'ğŸ‘‡':
                if (memory[currentPosition] === undefined) {
                    memory[currentPosition] = 0;
                }
                if (memory[currentPosition] === 0) {
                    memory[currentPosition] = 255;
                } else{
                    memory[currentPosition] = memory[currentPosition] - 1;
                }
                break;

            //AUMENTAR VALOR DE LA CELDA DE MEMORIA ACTUAL
            case 'ğŸ‘†':
                if (memory[currentPosition] === undefined) {
                    memory[currentPosition] = 0;
                }
                if (memory[currentPosition] === 255) {
                    memory[currentPosition] = 0;
                } else{
                    memory[currentPosition] = memory[currentPosition] + 1;
                }
                break;

            //MOVER A CELDA DE MEMORIA SIGUIENTE, Y SI ESTÃ SIN INICIALIZAR, PONER VALOR 0
            case 'ğŸ‘‰':
                currentPosition++;
                if(memory[currentPosition] === undefined){
                    memory[currentPosition] = 0;
                };
                break;

            //MOVER A CELDA DE MEMORIA ANTERIOR
            case 'ğŸ‘ˆ':
                currentPosition--;
                break;

            case 'ğŸ¤œ':
                if (memory[currentPosition] === 0) {
                    let numberOfLoop = loops.findIndex(array => array.find(key => key === i));
                    i = loops[numberOfLoop][1];
                }
                break;

            case 'ğŸ¤›':
                if (memory[currentPosition] !== 0) {
                    let numberOfLoop = loops.findIndex(array => array.find(key => key === i));
                    i = loops[numberOfLoop][0];
                }
                break;

            case 'ğŸ‘Š':
                console.log(i + " POSICION DE LA MANO " + correctInput[i]);
                console.log("ESTOY IMPRIMIENDO " + String.fromCharCode(memory[currentPosition]));
                document.getElementById(text).innerHTML = document.getElementById(text).innerHTML + (String.fromCharCode(memory[currentPosition]));
                break;
        
            default:
                break;
        }
    }
}

